import React, { useRef } from 'react'
import { AiFillCloseCircle } from 'react-icons/ai';
const Modal = () => {
  return (
    <div>Modal</div>
  )
}

export const ModalContent = (props) => {
    const ModalContentRef = useRef(null);

    return (
        <div ref = {ModalContentRef}>
            {props.children}
            <div>
                <AiFillCloseCircle/>
            </div>
        </div>
    )
}

export default Modal
